?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эту знаменитую часовую марку основал Урс Райзер. Урс Райзер родился в швейцарском городе, под названием Биль. На данный момент, этот город является столицей многих часовых марок (Omega, Rolex, Cartier, Rado). Так как он с детства интересовался устройством часов и механизмов, в 16 лет он принимает решение о поступлении в часовой техникум, для того, что бы стать часовщиком. После его окончания, он практически сразу устраивается на работу в Rado (там он проработал около 2-х лет). Но, несмотря на то, что Урс занимался любимым делом, ему что-то не нравилось в его деятельности. Он принимает решения об эмиграции в США, где открывает свой собственный магазин, в котором продавались швейцарские часы. После этого, он уже начал сам собирать часы, которые впоследствии, и продавал в собственном магазине. Покупателям его часы пришлись по вкусу, поэтому первую партию раскупили довольно таки быстро. Он решил расширить свой ассортимент, и в течение долгого времени, изготовлял новые коллекции. На данный момент, компания Ryser Kentfield является одной из самых популярных часовых марок (среди тех, которые считаются независимыми). Абсолютно все экземпляры собираются вручную. Часы Ryser Kentfield отлично подойдут людям, которые хотят подчеркнуть свою индивидуальность и собственный стиль.</span></span></p>
 
